* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;

}

html, body {
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
    background: var(--color-bg);
    scroll-behavior: smooth;

}

/***************** GLOBAL - Variables, Keyframes & Scroll JS  *****************/

:root {
    --size-100: 6.250em;
    --size-48: 3.2em;
    --size-40: 2.5em;
    --size-32: 2em;
    --size-24: 1.5em;
    --size-22: 1.375em;
    --size-20: 1.25em;
    --size-18: 1.125em;
    --size-16: 1em;
    --size-14: 0.875em;
    --color-bg: #fff;
    --color-black: #2b2b2b;
    --color-red: #ff3e3e;
    --color-grey: #b3b3b3;
    --space-220: 13.75em;
    --space-64: 4em;
    --space-48: 3em;
    --space-24: 1.5em;
    --space-16: 1em;
    --space-12: 0.75em;
    --font-serif: "big-caslon-fb", serif;
    --font-sans: "neue-haas-unica", sans-serif;
    --weight-reg: 400;
    --weight-bold: 600;
    --weight-black: 900;


}

/************ Keyframes *************/




/************** On Scroll Animation ***************/



a {
    text-decoration: none;
    list-style: none;
}

a:visited {
    text-emphasis: none;
    text-decoration: none;
    color: var(--color-black);
}


/************** Navigation ***************/

.navigation {
    display: grid;
    grid-template-columns: 2fr 1fr;
    width: 90vw;
    height: 100px;
    margin: 0 auto;
}

.menu-item {
    float: left;
    padding-left: 24px;
    font-family: var(--font-sans);
    font-size: var(--size-18);
    color: var(--color-black);
}

.menu li {
    list-style: none;

}

.menu {
    justify-self: end;
    align-self: center;
}

.logo {
    align-self: center;
}

.transition-fade {
    transition: 0.4s;
    transform: translateY(10px);
    opacity: 1;
  }

  html.is-animating .transition-fade {
    opacity: 0;
    transform: translateY(0);
  }





/************** Main Container & Global Classes ***************/

.transition-fade {
    display: grid;
    grid-template-columns: 1fr;
    grid-template-rows: auto;
    width: 90vw;
    margin: 0 auto;
    grid-row-gap: 13.75em;
}

.page-headline {
    font-family: var(--font-serif);
    font-size: calc(100px + 56 * ((100vw - 320px) / (2280)));
    line-height: 1.12;
    color: var(--color-black);
    font-weight: var(--weight-bold);

}

.section-headline {
    font-family: var(--font-serif);
    font-size: var(--size-48);
    color: var(--color-black);
    line-height: 1.2;
    font-weight: var(--weight-bold);
}


.section-desc {
    font-family: var(--font-sans);
    font-size: var(--size-22);
    color: var(--color-black);
    line-height: 1.5;
}

.links a {
    font-family: var(--font-serif);
    font-size: var(--size-22);
    color: var(--color-black);
    line-height: 1.5;
    border-bottom: 1px solid #cccccc;
    transition: all 0.7s;
    padding-bottom: 6px;

}

.links a:hover {
    border-bottom: 1px solid #ff3e3e;

}

.links {
    grid-column: 2 / 2;
}

.image-container {
    display: flex;
    /* width: 100%; */
    height: 850px;
    background: #F5F7F9; 
    grid-column: 1 / span 2;
    /* background: #FCE4FF; */
